import { Component } from 'react'
import { withRouter } from 'react-router'
import { connect } from 'react-redux'
import { Props } from '../interface/Interfaces'
// import { mapStateToProps, mapDispatchToProps } from '../app/functions'
import Navigation from '../components/header/Navigation'
import { setUserDataLogin } from '../app/hooks'

class Home extends Component<Props> {
    render = () => {
        return (
            <>
                <Navigation />
                <div className="index">
                    <h1>Home ... </h1>
                </div>
            </>
        )
    }
}

const mapStateToProps = (state: any) => ({
    temporer : state.temporer
})

const mapDispatchToProps = (dispatch: any) => {
    return {
        setUserDataLogin: (userData: any) => dispatch(setUserDataLogin(userData))
    }
}

export default withRouter(connect(mapStateToProps, mapDispatchToProps)(Home))
